import styled from "styled-components";

export const ContactIframe = styled.iframe`
  width: 100%;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  padding: 20px 80px;
  @media screen and (max-width: 800px) {
    padding: 0px;
  }
`;
